import React, { Component } from "react";
import ReactDOM from "react-dom";
import CardFood from "./CardFood";

class Food extends Component {
  constructor(props) {
    super(props);
  }
  componentDidMount() {
    checkClass = () => {
      return this.refs.pages.classList.contains("active");
    };
  }

  render() {
    return (
      <div
        id="carouselExampleIndicators"
        className="carousel slide"
        data-ride="carousel"
      >
        <ol className="carousel-indicators">
          <li
            data-target="#carouselExampleIndicators"
            data-slide-to="0"
            className="active"
          ></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
        </ol>

        <div className="carousel-inner">
          <div className="carousel-item active">
            <CardFood pages="first" />
          </div>
          <div className="carousel-item" id="second" refs="pages">
            <CardFood
              pages={this.checkClass.bind(this) ? "second" : undefined}
            />
          </div>
        </div>
        <a
          className="carousel-control-prev"
          href="#carouselExampleIndicators"
          role="button"
          data-slide="prev"
        >
          <i className="fa fa-chevron-left fa-lg text-muted"></i>
          <span className="sr-only">Previous</span>
        </a>
        <a
          className="carousel-control-next text-faded"
          href="#carouselExampleIndicators"
          role="button"
          data-slide="next"
        >
          <i className="fa fa-chevron-right fa-lg text-muted"></i>
          <span className="sr-only">Next</span>
        </a>
      </div>
    );
  }
}
export default Food;
